methods/applications/postApplications.ht.body:
Create Application
Creates an application that can handle calls and messages for one of your phone number. Many phone numbers can share an application.
Request URL
POSThttps://api.catapult.inetwork.com/v1/users/{userId}/applications/

Supported Parameters



Parameter
Description
Mandatory




name
A name you choose for this application.
Yes


incomingCallUrl
A URL where call events will be sent for an inbound call.
No


incomingCallUrlCallbackTimeout
Determine how long should the platform wait for incomingCallUrl's response before timing out in milliseconds.
No


incomingCallFallbackUrl
The URL used to send the callback event if the request to incomingCallUrl fails.
No


incomingMessageUrl
A URL where message events will be sent for an inbound SMS message
No


incomingMessageUrlCallbackTimeout
Determine how long should the platform wait for incomingMessageUrl's response before timing out in milliseconds.
No


incomingMessageFallbackUrl
The URL used to send the callback event if the request to incomingMessageUrl fails.
No


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. (If not set the default is HTTP POST)
No


autoAnswer
Determines whether or not an incoming call should be automatically answered. Default value is 'true'.
No



Example: Create an application named: 'MyFirstApp'
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/applications \
    -u {token}:{secret} \
    -H "Content-type: application/json" \
    -d \
    '
    {
        "name": "MyFirstApp",
        "incomingCallUrl": "http://example.com/calls.php",
        "incomingMessageUrl": "http://example.com/messages.php",
        "callbackHttpMethod": "GET",
        "autoAnswer": true
    }'

//Promise
client.Application.create({
    name: 'MyFirstApp',
    incomingCallUrl: 'http://your-server.com/CallCallback',
    incomingMessageUrl: 'http://your-server.com/MsgCallback'
})
.then(function (response) {
    console.log(response);
});

//Callback
client.Application.create({
    name: 'SampleApp2',
    incomingCallUrl: 'http://your-server.com/CallCallback',
    incomingMessageUrl: 'http://your-server.com/MsgCallback'
}, function (err, response) {
    if (err) {
        console.log(err);
    }
    else {
        console.log(response)
    }
});

var application = await client.Application.CreateAsync(new CreateApplicationData{
    Name = "SampleApp2",
    IncomingCallUrl = "http://your-server.com/CallCallback",
    IncomingMessageUrl = "http://your-server.com/MsgCallback"
});

application = Application.create(client, {
    :name => "SampleApp2",
    :incoming_call_url => "http://your-server.com/CallCallback",
    :incoming_message_url => "http://your-server.com/MsgCallback"
})

methods/applications/getApplicationsAppl.body:
Fetch Application Information
Gets information about one of your applications. No query parameters are supported.
Request URL
GEThttps://api.catapult.inetwork.com/v1/users/{userId}/applications/{applicationId}

Properties



Property
Description




id
The unique identifier for the application.


name
A name you choose for this application.


incomingCallUrl
A URL where call events will be sent for an inbound call. This is the endpoint where the Application Platform will send all call events. Either incomingCallUrl or incomingMessageUrl is required.


incomingCallUrlCallbackTimeout
Determine how long should the platform wait for incomingCallUrl's response before timing out in milliseconds.


incomingCallFallbackUrl
The URL used to send the callback event if the request to incomingCallUrl fails.


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. Values are "get" or "post", default: "post".


autoAnswer
Determines whether or not an incoming call should be automatically answered. Default value is 'true'.


incomingMessageUrl
A URL where message events will be sent for an inbound message. This is the endpoint where the Application Platform will send all message events. Either incomingMessageUrl or incomingCallUrl is required.


incomingMessageUrlCallbackTimeout
Determine how long should the platform wait for incomingMessageUrl's response before timing out in milliseconds.


incomingMessageFallbackUrl
The URL used to send the callback event if the request to incomingMessageUrl fails.



Example: Get an application's information
curl -v -X GET  https://api.catapult.inetwork.com/v1/users/{user-id}/applications/{applicationId}
  -u {token}:{secret} \
  -H "Content-type: application/json" \

// Promise
client.Application.get('a-j4f2jz53mq')
.then(function (response) {
    console.log(response);
});

// Callback
client.Application.get('a-zuwwfzzrbea',
    function (err, response) {
        if (err) {
            console.log(err);
        }
        else {
            console.log(response);
        }
});

var application = await client.Application.GetAsync("a-zuwwfzzrbea");
var applicationName = application.Name;

application = Application.get(client, "a-zuwwfzzrbea")
application_name = application[:name]


The above command returns JSON structured like this:

{
  "id": "{applicationId}",
  "name": "MyFirstApp",
  "incomingCallUrl": "http://example.com/calls.php",
  "incomingMessageUrl": "http://example.com/messages.php",
  "autoAnswer": true
}

methods/applications/postApplicationsApp.body:
Update Application
Makes changes to an application. POST a new JSON representation with the property values you desire to the URL that you got back in the "Location" header when you first created it.
Request URL
POSThttps://api.catapult.inetwork.com/v1/users/{userId}/applications/{applicationId}

NOTE: Properties you don't send will remain unchanged.



Supported Parameters



Parameter
Description
Mandatory




name
A name you choose for this application.
Yes


incomingCallUrl
A URL where call events will be sent for an inbound call.
No


incomingCallUrlCallbackTimeout
Determine how long should the platform wait for incomingCallUrl's response before timing out in milliseconds.
No


incomingCallFallbackUrl
The URL used to send the callback event if the request to incomingCallUrl fails.
No


incomingMessageUrl
A URL where message events will be sent for an inbound SMS message.
No


incomingMessageUrlCallbackTimeout
Determine how long should the platform wait for incomingMessageUrl's response before timing out in milliseconds.
No


incomingMessageFallbackUrl
The URL used to send the callback event if the request to incomingMessageUrl fails.
No


callbackHttpMethod
Determine if the callback event should be sent via HTTP GET or HTTP POST. (If not set the default is HTTP POST).
No


autoAnswer
Determines whether or not an incoming call should be automatically answered. Default value is 'true'.
No



Example: Update Application
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/applications/{applicationId} \
    -u {token}:{secret} \
    -H "Content-type: application/json" \
    -d '{"incomingCallUrl": "http://different.example.com/calls.php"}'

// Promise
client.Application.update('a-j4f2j6vjmqz53mq', {
    name: 'Rename App1',
    autoAnswer: false
})
.then(function (response) {
    console.log(response);
});

// Callback
client.Application.update('a-zudcfzzrbea',
    {
        name: 'Rename App2',
        autoAnswer: false
    },
    function (err, response) {
        if (err) {
            console.log(err);
        }
        else {
            console.log(response);
        }
});

await client.Application.UpdateAsync("a-zuwwfzzrbea", new UpdateApplicationData{
    Name =  "Rename App2",
    AutoAnswer = false
});

app.update({:name => "Rename App2", :auto_answer => false})

