    {
        "number": "{number2}",
        "nationalNumber": "{national_number2}",
        "price": "2.00",
        "location": "https://.../v1/users/.../phoneNumbers/{numberId2}"
    }
]

methods/bridges/postBridges.html.body:
Create Bridge
Create a new bridge.
Request URL
POSThttps://api.catapult.inetwork.com/v1/users/{userId}/bridges

Supported Parameters



Parameter
Description
Mandatory




bridgeAudio
Enable/Disable two way audio path (default = true).
No


callIds
The list of call ids in the bridge. If the list of call ids is not provided the bridge is logically created and it can be used to place calls later.
No



Example: Create a bridge with two calls and two way voice path
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/bridges/ \
    -u {token}:{secret} \
    -H "Content-type: application/json" \
    -d '{"bridgeAudio": "true", "callIds": ["{callId1}","{callId2}"] }'

//Promise
client.Bridge.create({
    bridgeAudio: true,
    callIds: ['c-qbs5kwrsyx6wsdi', 'c-zan4g74pprsq']
})
.then(function (response) {
    console.log(response);
});

//Callback
client.Bridge.create({
    bridgeAudio: true,
    callIds: ['c-qbsx6wsdi', 'c-zan4g7prsq']
}, function (err, response) {
        if(err) {
            console.log(err);
        }
        else {
            console.log(response);
        }
    });

var bridge = await client.Bridge.CreateAsync(new CreateBridgeData{
    BridgeAudio = true,
    CallIds = new[]{"c-qbsx6wsdi", "c-zan4g7prsq"}
});

bridge = Bridge.create(client, {
    :bridge_audio => true,
    :call_ids => ["c-qbsx6wsdi", "c-zan4g7prsq"]
})


The above command returns HTTP Status structured like this:
HTTP/1.1 201 Created
Location: /v1/users/{userId}/calls/{bridgeId}

Example: Create a bridge without calls
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/bridges/ \
